Содержание программы:
В течение четырех лет изучения данной специальности студенты получат и повысят навыки в сфере: формирования ассортимента товаров и услуг;
регулирования процессов хранения товаров, проведения инвентаризации, определения и списывания потерь;
осуществления приема и учета товаров по количественному и качественному содержанию и многое другое.
